import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom'

import AddBox from "../views/AddBox"
import ListBoxes from "../views/ListBoxes"

class AddBoxRoute extends Component{
    render(){
        return(
            <AddBox />
        )
    }
}

class ListBoxesRoute extends Component{
    render(){
      return(
         <ListBoxes />
      )
    }
}
class Routes extends Component{
  render(){
    return(
      <div>
        <Router>
          <div>
               <Route exact path="/addbox" component={AddBoxRoute} />
               <Route exact path="/listboxes" component={ListBoxesRoute} />
            </div>
        </Router>
      </div>
    )
  }
}

export default Routes;
